text:
@PtitPandaBNE Bonsoir @PtitPandaBNE, bienvenue sur notre page Twitter. 
Si vous avez oublié votre effet personnel, nous vous invitons à faire votre déclaration de perte via ce lien : [LIEN] 
Nous vous souhaitons une bonne soirée.

@RPeigney Bonsoir @RPeigney, merci de nous contacter sur Twitter.
Afin de vous aider à réserver votre billet, merci de nous préciser par DM votre parcours, dates de voyage, vols choisis, ainsi que le nombre de voyageurs.
Nous restons à votre écoute.

@LamineGUIRASSY Bonjour Lamine,

Nous vous remercions également pour vos remarques qui sont essentielles à l'amélioration de notre qualité de service. Nous restons ici à l’écoute car votre satisfaction est une de nos priorités. 

Bonne journée.

@LoysTwit @LoysTwit Bonjour, merci de nous avoir contactés via Twitter.
Nous vous avons apporté une réponse en DM.
Nous vous souhaitons une bonne journée.

@NY44c Bonjour @NY44c, merci de nous contacter sur Twitter.
Nous allons vous assister. Pouvez-vous nous en dire plus en DM ? 
Merci à vous.

@cyberguerre Bonjour Nicolas, bienvenue sur Twitter.
Il arrive que certaines des compagnies partenaires n'autorisent pas l'enregistrement via notre site. Dans ce cas, nous vous invitons à essayer via le site Internet de la compagnie en question ou directement à l'aéroport.
Belle journée.

@lizmarshmallows Bonsoir @lizmarshmallows, merci de nous avoir contactés via Twitter.
Nous allons vous assister. Pouvez-vous nous en dire plus en DM ?
Nous restons à votre écoute.

@Julesandcity Bonjour @Julesandcity, merci de nous contacter sur Twitter.
Afin de vous renseigner, merci de nous communiquer votre référence de réservation en DM.
À tout de suite.

@mathieum76 Bonjour Mathieu,

Nous sommes navrés pour l'annulation du vol AF 1701 due à des vérifications techniques. 
Nous restons à votre disposition ici ou en DM si besoin.

@DominoPharrell Bonjour Domino, merci de nous avoir contactés via Twitter.
Afin d’avoir plus d’informations, nous vous invitons à contacter le service client de Vietnam Airlines.
Nous vous souhaitons une bonne journée.

@Lee__Corn Bonjour @Lee__Corn, 
Vous pouvez retrouver le magazine AirFrance Madame en ligne en suivant ce lien 👉[LIEN]
Bonne lecture ✈ Guillaume

@VGailhaguet Ce fut un plaisir Vincent :)
N’hésitez pas à nous solliciter si vous avez d’autre demande.
Nous vous souhaitons une bonne journée.

@francepierre Bonjour Pierre.
 Nous vous remercions d'avoir pris le temps de nous faire partager votre expérience de voyage. Votre satisfaction est au cœur de nos priorités. Nous ne manquerons pas de transmettre votre chaleureux message à nos équipes. 
Auriez vous le numéro de votre dossier?
